function createHtmlFromArray(arr) {
    const createElement = (type, children) => {
        const element = document.createElement(type);
        if (children && children.length > 0) {
            children.forEach(child => {
                element.appendChild(createElement(child.type, child.children));
            });
        }
        return element;
    };

    const fragment = document.createDocumentFragment();
    arr.forEach(item => {
        fragment.appendChild(createElement(item.type, item.children));
    });

    return fragment;
}

